            "excerpt": "从国家统计局来看，工资一万以上的人群，不足3%。 而从网民的眼里看来，工资一万以上的人群，似乎遍地都是，至少超过20%，甚至2个网民里，就有一个工资上万的。 事实的真相，如果算上各式各样的补贴等，再算上个体经营商的人群，工资上万的人群占比，大概在6-8%之间，全国不会超过10%。 但有一点，这是按照全国人口统计的，如果去掉没有工作的儿童，以及已经退休的人群，那总体的占比，肯定突破10%。2022年2季度，有12个城市的平…",
            "excerpt_new": "从国家统计局来看，工资一万以上的人群，不足3%。 而从网民的眼里看来，工资一万以上的人群，似乎遍地都是，至少超过20%，甚至2个网民里，就有一个工资上万的。 事实的真相，如果算上各式各样的补贴等，再算上个体经营商的人群，工资上万的人群占比，大概在6-8%之间，全国不会超过10%。 但有一点，这是按照全国人口统计的，如果去掉没有工作的儿童，以及已经退休的人群，那总体的占比，肯定突破10%。2022年2季度，有12个城市的平…",
            "preview_type": "default",
