            "thumbnail": "https://picx1.zhimg.com/50/v2-68bbd3c5d9d5173a67607fc373f20ad0_720w.jpg?source=b6762063",
            "excerpt": "1、 我生来平平淡淡，没有显赫世家，没有倾城面貌。惊艳不了青春，斑驳不了岁月。可我依然想温暖时光，饱读诗书，努力弥补我这平淡出生，后期绚烂绽放。2、 那一天我21岁，在我一生的黄金时代，我有好多奢望。我想爱，想吃，还想在一瞬间变成天上半明半暗的云。后来我才知道，生活就是一个缓慢受锤的过程，人一天天老下去，奢望也天天消失……我觉得自己会永远生猛下去，什么锤不了我。 ——王小波 3、 读一些无用的书，做一些…",
            "excerpt_new": "1、 我生来平平淡淡，没有显赫世家，没有倾城面貌。惊艳不了青春，斑驳不了岁月。可我依然想温暖时光，饱读诗书，努力弥补我这平淡出生，后期绚烂绽放。2、 那一天我21岁，在我一生的黄金时代，我有好多奢望。我想爱，想吃，还想在一瞬间变成天上半明半暗的云。后来我才知道，生活就是一个缓慢受锤的过程，人一天天老下去，奢望也天天消失……我觉得自己会永远生猛下去，什么锤不了我。 ——王小波 3、 读一些无用的书，做一些…",
