            "excerpt": "我们学校就是我们年级的事。 在去年，这个年级某个班的女生，八年级的，平时挺混的一个，最开始说的是被初三的强了，好像是俩男的。这俩男的是双胞胎兄弟。 女生家长就把他们告了，说的是没几十万这事完不了。反正最后这俩兄弟一个进局子，另一个还在上学。 但是真实情况是女的本来就是很他们一起搞，人家本来就是自愿的，好像还挺野的，在公园里，原本也是俩兄弟一起，但是后面其中一个拍了视频。女生不同意，视频貌似还传出来…",
            "excerpt_new": "我们学校就是我们年级的事。 在去年，这个年级某个班的女生，八年级的，平时挺混的一个，最开始说的是被初三的强了，好像是俩男的。这俩男的是双胞胎兄弟。 女生家长就把他们告了，说的是没几十万这事完不了。反正最后这俩兄弟一个进局子，另一个还在上学。 但是真实情况是女的本来就是很他们一起搞，人家本来就是自愿的，好像还挺野的，在公园里，原本也是俩兄弟一起，但是后面其中一个拍了视频。女生不同意，视频貌似还传出来…",
            "preview_type": "default",
            "preview_text": "",
            "reshipment_settings": "allowed",
            "content": "<p data-pid=\"VH9xKzhW\">我们学校就是我们年级的事。</p><p data-pid=\"db42t9Tm\">在去年，这个年级某个班的女生，八年级的，平时挺混的一个，最开始说的是被初三的强了，好像是俩男的。这俩男的是双胞胎兄弟。</p><p data-pid=\"XXd9R0X_\">女生家长就把他们告了，说的是没几十万这事完不了。反正最后这俩兄弟一个进局子，另一个还在上学。</p><p data-pid=\"RTJp1Hxz\">但是真实情况是女的本来就是很他们一起搞，人家本来就是自愿的，好像还挺野的，在公园里，原本也是俩兄弟一起，但是后面其中一个拍了视频。女生不同意，视频貌似还传出来了，好像当时的全初三都看过了。女生受不了，就把他们告了，最后听说还是拿到了十几万。</p><p data-pid=\"FBoRIfaq\">现在那女生转学了，但是周五放学的时候还是回到我们学校看，就是说也不知道她怎么想的，总之有点毛病。</p><p data-pid=\"pE15_7Ts\">……</p><p data-pid=\"j4fhhoMr\">看了评论我才明白这件事好像挺严重的。</p><p data-pid=\"9I31Myzh\">可能是我带有一些我的主观意见吧，我觉得这女生就是该。</p><p data-pid=\"OrhBMBkA\">她之前在学校的时候就挺混的，最严重的一次就是把小学的小朋友给打了。当时我记得警察都来了。后面怎么解决的不知道，但是她还好好上学没退学。</p><p data-pid=\"8tv98Sbf\">这应该算是校园暴力了吧，反正我挺讨厌她的。</p>",
